import { useParams } from "react-router"


import axios from "axios";
import { useEffect, useState } from 'react';


function Carddetails(props){
var params = useParams(props)

var apiurl=`http://apibyashu.herokuapp.com/api/cake/ ${params.cakeid}`
var cakeid = params.cakeid
var [data,setData]=useState([]);
var [islodding,setLodding]=useState(true)
        useEffect(()=>{
            axios({method:"GET",url:apiurl,data:JSON}).then((response)=>{
                console.log("response",response.data.data)
                setData(response.data.data)
                setLodding(false)
            },(error)=>{

                console.log("error..",error)
                setLodding(false)
            });

},islodding)
    return(
        <>
        <div class="card">
        <div class="card-front" data-image-position="left">
          <div class="card-image card-image-left">
            <img src={data.image} />
          </div>
          <div class="card-content">
            <h3>Images on left</h3>
            <p>
              Images can be placed on the left of cards.
            </p>
          </div>
        </div>
      </div> 
        </>

    )
}
export default Carddetails
